TUMI トゥミ 026141 D4 Expandable Organizer Computer Brief/エクスパンダブル・オーガナイザー・コンピューター・ブリーフ BLACK/ブラック<br><br>

<b>おまけサービス！非売品！デルタエアライン ビジネスクラス搭乗でもらえるトラベルキットを一緒にお届けします！<br>
</b><img src="http://image.rakuten.co.jp/aloha-market/cabinet/accessory/bag/deltatumi.jpg" alt="ハワイ　レスポートサック" width="100%" height="100%" border="0"><br><br>



デザイン、技術、機能、パフォーマンスの全てにおいて、トゥミ史上究極の革新的なALPHA&#160;2&#160;ビジネスコレクション。常に進化を続けるというブランド理念を体現。特許取得のテクノロジーを採用し、デザインや機能に改良を加え、流れるようなデザイン、クリーンでモダンなスタイルに生まれ変わりました。<br><br>出張からデイリーユースまで 対応力のあるブリーフ
メインコンパートメントに拡張機能を備えた便利なブリーフ。取り外し可能なラップトップ・スリーブやアコーディオン式の書類スペースを内部に装備。赤いジッパープラーと赤のライニングが特徴のファスナーポケットには暗号化された個人情報が不当に読み取られるのを防止するTUMI ID LOCK&#8482;を搭載。IDカードやクレジットカードなどの収納に適しています。トリミングのレザーや内装のライニングには、トゥミを代表するバリスティックナイロンのプリントを施しました。特許を取得しているショルダーベルトは付根部分が可動し、高いフィット感を実現。肩への負荷も軽減します。本体はトゥミオリジナルのFXTバリスティックナイロン製。キャリーハンドルはオールレザー製。
注意：当製品にICカード乗車券（スイカ、パスモ、イコカ 等）を入れたままの状態で、自動改札機やカード読み取り機のご利用はできませんのでご注意ください。<br><br>サイズ：30.5*40.5*14cm（最大19cm）<br>ノートPCの収納可能サイズ：25.5*354.5*5cm<br><br>外装：
フロントのU字型ポケット&#160;
撥水加工を施したポケット
フロントのファスナーポケット
背面のファスナー/オープンポケット
アド・ア・バッグ・スリーブ
型押しされたレザー製のキャリーハンドル
取り外し/長さ調節可能なショルダーストラップ

内装：
取り外し可能なパッドで保護されたコンピュータースリーブ&#160;
IDロック搭載のファスナーポケット&#160;
パッドで保護されたタブレット用ポケット&#160;
オープンポケット&#160;
伸縮性のあるポケット&#160;
カードポケット&#160;
ペンループ&#160;
キーリーシュ

素材：FXTバリスティックナイロン
キャリーハンドル：レザー<br><br>購入時のレシートを商品と一緒にお送りしますので、買い付け日より最大５年間、グローバル保証付きですので、日本でも保証対象となります！<br><br>ダンボールなどはございません。TUMI直営店で買い付け時にもらったショッピングバッグと一緒にお届けします。<br><b>配送方法：</b>ヤマト運輸<br>
日本全国一律 <b>700円（沖縄のぞく）</b><br>※4320円以上で送料500円（沖縄のぞく）
<br><br><b>6480円以上で送料無料！（沖縄除く）</b><br><br>ご質問などお気軽にメールでお問い合わせくださいませ♪すぐに返信しますよ！
